summary.label:
Oltre 100 preparazioni tra antipasti, primi, secondi, contorni e dolci, con speciali indicazioni per la cottura in pentola a pressione. Scopri la praticità del timer abbinato a ogni ricetta: fai partire il countdown per tenere il tempo di cottura e capire esattamente quando è pronto.

L’applicazione Lagostina ti consente di:
•	Consultare le ricette in base a difficoltà, tempi, procedimento e ingredienti;
•	Avere indicazioni sui tempi di cottura dei principali alimenti;
•	Attivare il timer a ogni step di cottura;
•	Consultare guide e video per migliorare le tue skill nella cottura a pressione;
•	Registrare i tuoi prodotti nell’area riservata Lagostina;
•	Ricevere notifiche sulle principali promozioni e novità di Lagostina.

Affidati all’esperienza Lagostina, una garanzia per la buona cucina italiana. Scarica l’app gratuitamente e libera la tua fantasia ai fornelli.
